class LabelService(object):
    def evaluate(self, speech_dirs, indices=[]):
        dir_labels = {}
        if indices:
            real_labels = [self.labels[i] for i in indices]
        else:
            real_labels = [os.dirname(d) for d in speech_dirs]
        for i, label in enumerate(real_labels):
            if label not in self.labels:
                real_labels[i] = "_unknown_"
            dir_labels[speech_dirs[i]] = real_labels[i]
        accuracy = []
        for folder in speech_dirs:
            for filename in os.listdir(folder):
                fp = os.path.join(folder, filename)
                with wave.open(fp) as f:
                    b_data = f.readframes(16000)
                label, _ = self.label(b_data)
                accuracy.append(int(label == dir_labels[folder]))
        return sum(accuracy) / len(accuracy)

    def label(self, wav_data):
        raise NotImplementedError


class TorchLabelService(LabelService):
    def __init__(self, model_filename, no_cuda=False, labels=["_silence_", "_unknown_", "command", "random"]):
        self.labels = labels
        self.model_filename = model_filename
        self.no_cuda = no_cuda
        self.audio_processor = AudioPreprocessor()
        self.reload()

    def reload(self):
        config = model.find_config(model.ConfigType.CNN_TRAD_POOL2)
        config["n_labels"] = len(self.labels)
        self.model = model.SpeechModel(config)
        if not self.no_cuda:
            self.model.cuda()
        self.model.load(self.model_filename)
        self.model.eval()

    def label(self, wav_data):
        """Labels audio data as one of the specified trained labels

        Args:
            wav_data: The WAVE to label

        Returns:
            A (most likely label, probability) tuple
        """
        wav_data = np.frombuffer(wav_data, dtype=np.int16) / 32768.
        dimension_fix = np.zeros((16000))
        dimension_fix[0:wav_data.shape[0]] = wav_data
        preprocessed_data = self.audio_processor.compute_mfccs(dimension_fix)
        model_in = torch.from_numpy(preprocessed_data.squeeze(2)).unsqueeze(0)
        model_in = torch.autograd.Variable(model_in, requires_grad=False)
        if not self.no_cuda:
            model_in = model_in.cuda()
        predictions = F.softmax(self.model(model_in), dim=1).data.numpy()
        return (self.labels[np.argmax(predictions)], np.max(predictions))


def make_abspath(rel_path):
    if not os.path.isabs(rel_path):
        rel_path = os.path.join(os.path.dirname(os.path.realpath(__file__)), rel_path)
    return rel_path


def load_service(config):
    model_path = make_abspath(config["model_path"])
    commands = ["__silence__", "__unknown__"]
    commands.extend(config["commands"].split(","))

    lbl_service = TorchLabelService(model_path, labels=commands, no_cuda=config["model_options"]["no_cuda"])
    return lbl_service


def truncated_normal(tensor, std_dev=0.01):
    tensor.zero_()
    tensor.normal_(std=std_dev)
    while torch.sum(torch.abs(tensor) > 2 * std_dev) > 0:
        t = tensor[torch.abs(tensor) > 2 * std_dev]
        t.zero_()
        tensor[torch.abs(tensor) > 2 * std_dev] = torch.normal(t, std=std_dev)



class SerializableModule(nn.Module):
    def __init__(self):
        super().__init__()

    def save(self, filename):
        torch.save(self.state_dict(), filename)

    def load(self, filename):
        self.load_state_dict(torch.load(filename, map_location=lambda storage, loc: storage))


class SpeechModel(nn.Module):
    def __init__(self, config=None):
        super().__init__()
        if config is None:
            parser = argparse.ArgumentParser()
            parser.add_argument(
                "--config",
                type=str,
                default="",
                help="The config file to use")
            flags, _ = parser.parse_known_args()
            if not flags.config:
                flags.config = os.path.join(os.path.dirname(os.path.realpath(__file__)), "config.json")
            with open(flags.config) as f:
                config = json.loads(f.read())
            commands = ["__silence__", "__unknown__"]
            commands.extend(config["commands"].split(","))
            config = model.find_config(model.ConfigType.CNN_TRAD_POOL2)
            config["n_labels"] = len(commands)
        n_labels = config["n_labels"]
        n_featmaps1 = config["n_feature_maps1"]

        conv1_size = config["conv1_size"]  # (time, frequency)
        conv1_pool = config["conv1_pool"]
        conv1_stride = tuple(config["conv1_stride"])
        dropout_prob = config["dropout_prob"]
        width = config["width"]
        height = config["height"]
        self.conv1 = nn.Conv2d(1, n_featmaps1, conv1_size, stride=conv1_stride)
        tf_variant = config.get("tf_variant")
        self.tf_variant = tf_variant
        if tf_variant:
            truncated_normal(self.conv1.weight.data)
            self.conv1.bias.data.zero_()
        self.pool1 = nn.MaxPool2d(conv1_pool)
        with torch.no_grad():
            x = Variable(torch.zeros(1, 1, height, width))
            x = self.pool1(self.conv1(x))
            conv_net_size = x.view(1, -1).size(1)
            last_size = conv_net_size

            if "conv2_size" in config:
                conv2_size = config["conv2_size"]
                conv2_pool = config["conv2_pool"]
                conv2_stride = tuple(config["conv2_stride"])
                n_featmaps2 = config["n_feature_maps2"]
                self.conv2 = nn.Conv2d(n_featmaps1, n_featmaps2, conv2_size, stride=conv2_stride)
                if tf_variant:
                    truncated_normal(self.conv2.weight.data)
                    self.conv2.bias.data.zero_()
                self.pool2 = nn.MaxPool2d(conv2_pool)
                x = self.pool2(self.conv2(x))
                conv_net_size = x.view(1, -1).size(1)
                last_size = conv_net_size

            self.output = nn.Linear(last_size, n_labels)
            if tf_variant:
                truncated_normal(self.output.weight.data)
                self.output.bias.data.zero_()
            self.dropout = nn.Dropout(dropout_prob)

    def forward(self, x):
        x = F.relu(self.conv1(x.unsqueeze(1)))  # shape: (batch, channels, i1, o1)
        x = self.dropout(x)
        x = self.pool1(x)
        if hasattr(self, "conv2"):
            x = F.relu(self.conv2(x))  # shape: (batch, o1, i2, o2)
            x = self.dropout(x)
            x = self.pool2(x)
        x = x.view(x.size(0), -1)  # shape: (batch, o3)
        return self.output(x)


class VoiceCommandDataset(Dataset):
    def __init__(self, base_folder, variant="tune", transform=None, target_transform=None):
        self.transform = transform
        self.target_transform = target_transform
        self.sound_folder = base_folder
        self.variant = variant
        self.ver = variant == "tune"
        self.lengths = []
        self.commands = []
        self.audio_processor = AudioPreprocessor()
        c = 0
        for command in os.listdir(self.sound_folder):
            if str(command) not in ["yes", "no", "up", "down", "on", "off", "left", "right", "stop", "go"]:
                continue

            command_folder = os.path.join(self.sound_folder, command)
            files = len(os.listdir(command_folder))
            self.lengths.append(0)
            self.commands.append(str(command))
            for i, file in enumerate(os.listdir(command_folder)):
                if files % 2 == 1 and i == files - 1:
                    break

                if i % 2 == self.ver:
                    self.lengths[c] += 1
            c += 1

    def __len__(self):
        return sum(self.lengths)

    def __getitem__(self, idx):
        n = idx
        for idn in range(len(self.lengths) + 1):
            if n < 0:
                c = self.commands[idn - 1]
                # print(len(os.listdir(os.path.join(self.sound_folder, c))),2 * n + (1 - self.ver))
                filename = os.listdir(os.path.join(self.sound_folder, c))[2 * n + (1 - self.ver)]
                fp = os.path.join(os.path.join(self.sound_folder, c), filename)
                with wave.open(fp) as f:
                    data = np.frombuffer(f.readframes(16000), dtype=np.int16) / 32768.
                    dimension_fix = np.zeros(16000)
                    dimension_fix[0:data.shape[0]] = data
                    sound = torch.from_numpy(self.audio_processor.compute_mfccs(dimension_fix).squeeze(2)).unsqueeze(
                        0)
                    sound = torch.autograd.Variable(sound, requires_grad=False)
                    label = c
                break
            else:
                n -= self.lengths[idn]
        if self.transform:
            sound = self.transform(sound)
        if self.target_transform:
            label = self.target_transform(label)
        return sound  # , label

from torch.nn import (Conv2d, Linear, MaxPool2d,
                      Module, ReLU, Sequential, Softmax)
class Classifier(Module):
    def __init__(
        self, convs: Sequential, linears: Sequential, use_softmax: bool = True
    ):
        super().__init__()
        self.convs = convs
        self.linears = linears
        self.softmax = Softmax(1) if use_softmax else Sequential()

    def forward(self, inputs: torch.Tensor) -> torch.Tensor:
        outconvs = self.convs(inputs)
        outlins = self.linears(outconvs.view(outconvs.shape[0], -1))
        return self.softmax(outlins)


class Unsqueeze(nn.Module):
    def __init__(self, dim):
        super().__init__()
        self.dim = dim

    def __repr__(self):
        return f'View x.unsqueeze({self.dim})'

    def forward(self, inpiut):
        '''
        Reshapes the input according to the shape saved in the unsqueeze data structure.
        '''
        out = inpiut.unsqueeze(self.dim)
        return out

class Honk(Classifier):
    def __init__(self, convs=None, linears=None):
        if convs is None:
            convs = Sequential(*(
                    [Unsqueeze(0)] +
                    [Conv2d(1, 64, (20, 8), stride=(1, 1))] +
                    [ReLU(inplace=True),
                     # Dropout(0.5)
                     ] +
                    [
                        MaxPool2d((2, 2), (2, 2)),
                        Conv2d(64, 64, (10, 4), stride=(1, 1))] +
                    [ReLU(inplace=True),
                     # Dropout(0.5)
                     ] +
                    [MaxPool2d((1, 1), (1, 1))]
                # [View()]
            ))
        if linears is None:
            linears = Sequential(Linear(26624, 12))
        super().__init__(convs, linears)

